package com.loop;

public class SwitchProgram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num = 50;
		switch(num){
		case 1:
			System.out.println("One");
			break;
		case 2:
			System.out.println("Two");
			break;
		case 50:
			System.out.println("Fifty");
			break;
		default:
			System.out.println("End");
			break;
		}
	}

}
